<div class="header"><?php include("header.php"); ?></div><h1>bible-uedin</h1><p>This is a multilingual parallel corpus created from translations of the Bible <a href="https://github.com/christos-c/bible-corpus">compiled by Christos Christodoulopoulos and Mark Steedman</a>.</p><p>102 languages, 5,148 bitexts<br>total number of files: 107<br>total number of tokens: 56.43M<br>total number of sentence fragments: 2.84M<br><p>Please cite OPUS and <a href="http://link.springer.com/article/10.1007/s10579-014-9287-y">A massively parallel corpus: the Bible in 100 languages</a>, Christos Christodoulopoulos and Mark Steedman, *Language Resources and Evaluation*, 49 (2)<h3>Download</h3><p>Below you can download data files for all language pairs in different formats and with different kind of annotation (if available). You can click on the various links as explained below. In addition to the files shown on this webpage, OPUS also provides pre-compiled word alignments and phrase tables, bilingual dictionaries, frequency counts, and these files can be found through the <a href="/index.php">resources search form on the top-level website of OPUS</a>. <p>License: CC0 1.0</p><table><tr><td>Bottom-left triangle: download files<ul><li><i>ces</i> = sentence alignments in XCES format</li> <li><i>leftmost column language IDs</i> = tokenized corpus files in XML</li> <li>TMX and plain text files (Moses): see "Statistics" below</li> <li><i>lower row language IDs</i> = parsed corpus files (if they exist)</li></ul></td><td>Upper-right triangle: sample files <ul><li><i>view</i> = bilingual XML file samples</li> <li><i>upper row language IDs</i> = monolingual XML file samples</li> <li><i>rightmost column language IDs</i> = untokenized corpus files</li></ul></td></tr></table><p><div class="sample"><table border="0" cellpadding="0">
